script:
const OCL = window.OCL;

if (this.event !== 'button') return;

var data = get('data');
var tPredictor = API.cache('tPredictor');

var mol = OCL.Molecule.fromIDCode(data.structure.value);
var details = getDetail(mol, parseInt(this.button));

set('details', details);

function getDetail(mol, type) {
    var details = tPredictor.getDetail(mol, type);
    var result = [];
    for (var i = 0; i < details.length; i++) {
        if (details[i].type === 2) {
            if (details[i+1] && details[i+1].type === 1) {
                result.push(
                    {
                        desc: details[i].value,
                        mol: {type: 'oclid', value: details[i+1].value}
                    }
                );
            }
            i++;
        } else {
            result.push(
                {desc: details[i].value}
            );
        }
    }
    return result;
}

switch (this.variable) {
    case 'molfile':
        this.action = {
            name: 'updateMolfile',
            value: API.getData('molfile').resurrect(),
        }
        break;
}



const actionValue=this.action.value;
console.log(actionValue);
const dataArray = API.getData('dataArray');


switch (this.action.name) {
    case 'switchToLayer':
        API.switchToLayer(actionValue);
        break;
    case 'removeStructure':
        var id=-1;
        dataArray.forEach( (item, i) => {
            if (Number(item._highlight)===Number(actionValue._highlight)) {
                id=i;
            }
        });
        if (id>=0) {
            dataArray.splice(id, 1);
            dataArray.triggerChange();
        }
        break;
    case 'appendStructure':
        let data=API.getData('data');
        console.log(data)
        appendStructure(data);
        dataArray.triggerChange();
        break;
    case 'updateMolfile': 
        let molecule=OCL.Molecule.fromMolfile(actionValue);
        let prediction = getPrediction(molecule);
        API.createData('data', prediction);
        break;
    case 'appendSmiles': 
        let smiles=actionValue.split(/[\r\n;, ]+/).filter( smile => smile );
        for (let smile of smiles) {
            let molecule=OCL.Molecule.fromSmiles(smile);
            let prediction = getPrediction(molecule);
            appendStructure(prediction);
        }
        dataArray.triggerChange();
        break;
}

function appendStructure(data) {
    if (dataArray.filter( item => item.id==data.id ).length>0) return;
    console.log('xx');
    let logP=data.logP;
    var min=0;
    var max=5;
    if (logP<min) logP=min;
    if (logP>max) logP=max;
    data.color='hsl(' + Math.floor(360-((logP-min)/(max-min)*120)) +',65%,65%)';
    data._highlight=Math.random();
    dataArray.push(JSON.parse(JSON.stringify(data)));
}


function getPrediction(mol) {

    var TP = OCL.ToxicityPredictor;
    var DP = OCL.DruglikenessPredictor;

    var tPredictor = API.cache('tPredictor');
    var dPredictor = API.cache('dPredictor');
    if (!tPredictor) {
        tPredictor = new TP();
        dPredictor = new DP();
        API.cache('tPredictor', tPredictor);
        API.cache('dPredictor', dPredictor);
    }

    var mRisk = tPredictor.assessRisk(mol, TP.TYPE_MUTAGENIC);
    var tRisk = tPredictor.assessRisk(mol, TP.TYPE_TUMORIGENIC);
    var iRisk = tPredictor.assessRisk(mol, TP.TYPE_IRRITANT);
    var rRisk = tPredictor.assessRisk(mol, TP.TYPE_REPRODUCTIVE_EFFECTIVE);

    console.log({mRisk, tRisk, iRisk, rRisk})

    var props=new OCL.MoleculeProperties(mol);

    var logP = props.logP;
    var logS = props.logS;
    var hDonor = props.donorCount;
    var hAcceptor = props.acceptorCount;
    var rotatableBond = props.rotatableBondCount;
    var stereoCenter = props.stereoCenterCount;


    var mw = mol.getMolecularFormula().relativeWeight;
    var psa = props.polarSurfaceArea;

    var likeness = dPredictor.assessDruglikeness(mol);

    var drugScore = OCL.DrugScoreCalculator.calculate(logP, psa, mw, likeness, [mRisk, tRisk, iRisk, rRisk]);

    var data = {
        id: mol.getIDCode(),
        structure: mol.toMolfile(),
        mutagenic: getColor(mRisk),
        tumorigenic: getColor(tRisk),
        irritant: getColor(iRisk),
        reproductive: getColor(rRisk),
        logP,
        logPI: getIndicator(logP, -5, 5),
        logS,
        logSI: getIndicator(logS, -5, 5),
        mw,
        mwI: getIndicator(mw, 100, 500),
        psa,
        psaI: getIndicator(psa, 0, 40),
        likeness,
        likenessI: getIndicator(likeness, -10, 10, {color: {under:'red', over:'green'}}),
        drugScore,
        drugScoreI: getIndicator(drugScore, -1, 1, {color: {under:'red', over:'green'}}),
        hDonor,
        hDonorI: getIndicator(hDonor, 0, 10),
        hAcceptor,
        hAcceptorI: getIndicator(hAcceptor, 0, 20),
        stereoCenter,
        stereoCenterI: getIndicator(stereoCenter, 0, 10),
        rotatableBond,
        rotatableBondI: getIndicator(rotatableBond, 0, 10),
    };

    return data;

    function getColor(risk) {
        if (risk === 1) return 'lime';
        if (risk === 2) return 'orange';
        if (risk === 3) return 'red';
    }

    function getIndicator(value, min=0, max=100, options={}) {
        const {
            color=false
        } = options;
        if (value<min) value=min;
        if (value>max) value=max;
        let middle=(min+max)/2;
        let length=(value-min)/(max-min)*100;
        if (color) {
            length/=2;
            // need to know if it is color1 or color2 compare to the middle
            if (value<middle) {
                return [
                    {size: 50-length, bgcolor: 'white'},
                    {size: length, bgcolor: color.under},
                    {size: 50+30, bgcolor: 'white'}
                ];
            } else {
                return [
                    {size: 50, bgcolor: 'white'},
                    {size: length, bgcolor: color.hover},
                    {size: 50-length+30, bgcolor: 'white'}
                ];
            }

        } else {
            return [
                {size: length, bgcolor: 'grey'},
                {size: 100-length+30, bgcolor: 'white'}
            ];
        }
    }
}

const [
    OCL
] = await API.require([
    'openchemlib',
]);

// need to register helper for safety prediction
await OCL.Resources.registerFromUrl()

API.createData('molfile', '')

if (typeof IframeBridge !== 'undefined') {
    IframeBridge.onMessage(onMessage);
    IframeBridge.ready();
    function onMessage(data) {
        if (data.type === 'tab.data') {
            if (data.message && data.message.uuid) {
                require(['vh/eln/Sample'], function(Sample) {
                    var sample = new Sample(data.message.couchDB, data.message.uuid, {
                        track:false
                    });
                    doPrediction();
                });
            } else {
               API.require('vh/eln/SetAndTrack').then( () => doPrediction() );
            }
        }
        if (data.type === 'tab.focus') {};
    }
} else {
    API.require('vh/eln/SetAndTrack').then( () => doPrediction() );
}

API.createData('help','https://cheminfo.github.io/www.c6h6.org/molecules/propertyExplorer/');

API.createData('dataArray', []);

API.require('vh/util/docs').then( Docs => {
    Docs.addPageHelp({iconSize:'fa-4x'});
});
